      page_title: "ePortofolio Saya"
      what: 
        details1: |-
            ePortofolio adalah tempat Anda dapat menampilkan dan mendiskusikan
            penyerahan dan pengalaman signifikan yang terjadi selama proses pembelajaran
            Anda. Anda dapat menggunakan ePortofolio untuk: 
            
            * Menampilkan makalah yang Anda banggakan atau hanya untuk dilihat oleh instruktur Anda
            * Berbicara tentang semua pemikiran dan pekerjaan yang berlangsung di dalam penyerahan kelas Anda
            * Mengumpulkan tinjauan umum pengalaman pendidikan Anda secara keseluruhan
            * Berbagi pekerjaan Anda dengan teman, perusahaan di masa depan, dll.
            
            ePortofolio dapat menjadi publik yang dapat dilihat oleh semua orang atau privat yang hanya dapat dilihat oleh mereka
            yang Anda izinkan untuk melihat, dan Anda dapat mengubah pengaturan itu kapan saja.
            
            Siap memulai? Klik tombol.
    wizard_box: 
      finish: 
        body: "Siap memulai? Anda selalu dapat kembali ke panduan ini dari halaman apa pun dengan mengeklik tautan \"%{help_link_text}\" yang Anda lihat di sana."
      headers: 
        finish: "Ayo Lakukan"
        getting_started: Memulai
        instructions: "Menggunakan ePortofolio"
        introduction: Pengantar
        page_content: "Daftar Halaman"
        pages: "Halaman Bagian"
        sections: "Bagian Portofolio"
        settings: "Pengaturan ePortofolio"
        submissions: "Menambah Penyerahan"
      introduction: 
        body: "ePortofolio adalah tempat untuk memperlihatkan pekerjaan Anda. Ini terdiri dari bagian dan halaman. Daftar bagian ada di sepanjang sisi kiri jendela (%{showme1}). Setiap bagian dapat memiliki banyak halaman, yang ditampilkan pada sisi kiri jendela (%{showme2})."
      links: 
        portfolio: "Lihat Portofolio"
      page_content: 
        body1: "Konten yang Anda lihat di suatu halaman adalah konten yang sama seperti yang dilihat pengunjung. Untuk mengedit konten ini, klik tautan \"%{edit_link_text}\" (%{showme}) dan halaman akan berubah menjadi mode pengeditan."
        body2: "Sekarang Anda mengedit! Ubah nama halaman atau ubah opsi pemberian komentar (%{showme1}) jika Anda mau. Anda dapat menyimpan, mempratinjau, atau membatalkan perubahan yang Anda buat kapan saja dengan mengeklik tombol di sisi kanan (%{showme2})."
        body3: "Konten terbagi menjadi sub-bagian, yang masing-masingnya memiliki batas putus-putus. Anda dapat mengedit atau menghapus konten dari suatu sub-bagian dengan mengeklik ikon %{edit_icon} atau %{delete_icon} di sudut kanan atas dari sub-bagian."
        body4: "Untuk menambah sub-bagian baru, temukan dan klik jenis konten yang Anda ingin tambahkan di dalam daftar opsi di sisi kanan halaman (%{showme})."
      pages: 
        body1: "Bagian memiliki banyak halaman. Anda dapat melihat daftar halaman untuk bagian saat ini di sisi kanan jendela (%{showme1}). Untuk mengorganisasikan atau menambah halaman, klik tautan\"%{manage_pages}\" (%{showme2})."
        body2: "Anda dapat mengubah nama halaman apa pun dengan mengeklik ikon %{edit_icon} yang muncul, menghapus halaman dengan mengeklik ikon %{delete_icon}, atau mengatur ulang urutan halaman dengan mengeklik dan menyeretnya."
      sections: 
        body1: "Bagian tertera sepanjang sisi kiri jendela (%{showme1}). Setiap bagian dapat memiliki banyak halaman di dalamnya. Untuk mengorganisasikan atau menambah bagian, klik tautan\"%{manage_sections}\" (%{showme2})."
        body2: "Anda dapat mengubah nama bagian apa pun dengan mengeklik ikon %{edit_icon} yang muncul, mengatur ulang bagian dengan mengeklik dan menyeretnya, atau menghapus bagian dengan mengeklik ikon %{delete_icon}."
      settings: 
        body: "Untuk mengubah pengaturan di ePortofolio Anda, klik tautan \"Pengaturan ePortofolio\" (%{showme}). Anda dapat mengubah nama portofolio serta mengubah apakah publik atau privat. Portofolio privat hanya tampak oleh mereka yang Anda beri akses."
      submissions: 
        body1: "Anda mungkin melihat di bagian bawah halaman ini ada suatu daftar dari penyerahan terkini dari kelas Anda (%{showme}). Anda dapat dengan cepat menambah penyerahan ke halaman baru di portofolio Anda dari halaman ini. Klik saja penyerahan yang Anda ingin tambahkan dan dialog sederhana akan muncul."
        body2: "Hebat! Untuk menyelesaikan penambahan penyerahan, Anda harus memilih bagian apa yang Anda ingin tambahkan dan berikan nama kepada halaman itu. Setelah Anda mengeklik “Tambah Halaman\" Anda akan dibawa ke halaman baru itu sehingga Anda bisa mengeditnya secara lebih terperinci jika Anda mau."
