    grade_export: 
      description: "Ekspor Nilai untuk SIS"
      name: "Ekspor Nilai"
    grade_export_settings: 
      description: |-
          Plugin ini memungkinkan nilai final akan diterbitkan kembali ke siswa informasi siswa (SIS).  Saat diaktifkan, pengguna akan diberi opsi di gradebook untuk menerbitkan nilai ini.  Ini akan terjadi melalui permintaan POST ke titik akhir terbit yang ditentukan.  Setiap jenis menentukan format konten dan jenis mime-nya sendiri.  Respons dari titik akhir tidak menjadi masalah dan saat ini diabaikan.
          
          Misalnya, CSV berformat Instructure akan MEMPOSTING file csv dengan jenis mime 'text/csv' ke titik akhir yang ditentukan, yang berisi kolom berikut: 
          
          "publisher\_id", "publisher\_sis\_id", "course\_id", "course\_sis\_id", "section\_id", "section\_sis\_id", "student\_id", "student\_sis\_id", "enrollment\_id", "enrollment\_status", "score", "grade", "custom\_grade\_status"
          
          (Catatan: kolom “nilai” hanya diberikan jika kursus menentukan standar penilaian)
          
          Untuk setiap siswa pada kursus yang diterbitkan, akan ada 1 atau lebih baris pada csv yang diterbitkan. Secara spesifik, akan ada 1 baris untuk setiap login yang dimiliki siswa di akun root kursus.  Sebagian besar waktu, ini akan menghasilkan 1 baris per siswa, tetapi jika siswa memiliki beberapa info login, akan ada satu baris untuk masing-masing baris.
          
          Jika "Sertakan penggantian nilai akhir" dicentang, dan fitur Override Nilai Final diaktifkan, siswa dengan nilai/skor yang diganti akan menerimanya sebagai pengganti skor dan nilai yang dihitung.
      labels: 
        format_type: "Jenis format output"
        include_final_grade_overrides: "Sertakan override nilai final"
        publish_endpoint: "Titik akhir untuk diterbitkan"
        success_timeout: "Waktu habis notifikasi berhasil (dalam detik)"
        wait_for_success: "Tunggu notifikasi berhasil"
