        equation_functions: "Selain dari variabel, juga ada kumpulan fungsi pembantu yang Anda bisa gunakan untuk membuat nilai yang bermanfaat. Misalnya: %{example} Untuk melihat penjelasan dari fungsi pembantu yang diberikan, pilihlah dari daftar di bawah ini:"
        equation_intro: "Pertanyaan yang dikalkulasi didasarkan pada serangkaian dari satu atau lebih rumus yang dihitung secara berurutan. Anda dapat menentukan variabel perantara di dalam rumus-rumus ini, tetapi hasil numerik dari rumus terakhir adalah yang digunakan untuk membuat jawaban yang benar. Misalnya: %{example} Untuk serangkaian rumus ini, jawaban finalnya adalah 71. Namun, tidak ada variabel yang telah ditentukan sebelumnya, jadi semua siswa mungkin memiliki pertanyaan yang sama dengan jawaban yang sama. Lihat tab “variabel” untuk informasi lainnya tentang variabel."
