  this_report_provides_a_list_of_all_developer_keys__dd2bfadf: "Laporan ini menyediakan daftar semua Kunci Pengembang yang tersedia untuk institusi ini. Kunci ini dapat diinstal langsung di akun root tempat laporan dijalankan atau dapat diwariskan dari akun root induk. Kunci Pengembang dapat berupa API atau kunci LTI."
  this_report_provides_all_active_eportfolios_for_th_f7432621: "Laporan ini menyediakan semua ePortofolio aktif untuk institusi saat ini. Secara opsional, pilih 'Hanya sertakan ePortofolio dari pengguna yang tidak memiliki pendaftaran' untuk mengurangi cakupan hasil ePortofolio hanya untuk pengguna yang tidak memiliki pendaftaran. Anda juga dapat menjalankan laporan dengan 'Sertakan Objek yang Dihapus' untuk hanya menyertakan ePortofolio yang telah dihapus."
  this_report_provides_transparency_regarding_instru_6f9e227e: "Laporan ini menyediakan transparansi tentang akses karyawan Instructure ke akun. Pemberian akses memungkinkan seorang karyawan Instructure mengakses akun selama durasi terbatas (mis. ketika mendukung akun atau merespons insiden). Jika diberikan, karyawan harus memperbaruinya sebelum mengakses akun melalui antarmuka pengguna atau API."
  this_report_shows_all_learning_outcomes_that_exist_e77bd04b: "Laporan ini menunjukkan seluruh hasil pembelajaran yang ada dalam akun ini. File csv yang dihasilkan akan memiliki satu baris per hasil, dan akan menampilkan detail semua atribut terkait dengan setiap hasil."
  this_report_shows_all_the_activity_from_users_enro_46394fa6: |-
      Laporan ini menunjukkan semua aktivitas dari pengguna yang terdaftar dalam kursus yang ditetapkan
        atau semua kursus dalam satu durasi akademis yang ditetapkan. File csv yang dihasilkan akan
        memiliki satu baris per aktivitas siswa dan akan memiliki header berikut; enrollment_type,
        id bagian, id sis bagian, nama bagian, id kursus, id sis kursus, nama kursus, id pengguna,
        id sis pengguna, jenis konten, konten, frekuensi dilihat, frekuensi turut serta, terakhir
        dilihat. Frekuensi dilihat dan frekuensi turut serta adalah penghitung sejak
        awal waktu hingga laporan dibuat.
  this_report_shows_all_the_activity_from_users_enro_8f8e0ca1: |-
      Laporan ini menampilkan semua aktivitas dari pengguna yang terdaftar di semua kursus 
        dalam suatu durasi akademis yang ditetapkan. File csv yang dihasilkan akan memiliki satu
        baris per aktivitas siswa dan akan memiliki header berikut: id bagian, id sis bagian,
        nama bagian, id kursus, id sis kursus, nama kursus, id durasi akademis, id sis durasi akademis,
        nama durasi akademis, id pengguna, id sis pengguna, nama pengguna, jenis konten, konten,
        frekuensi dilihat, frekuensi turut serta, terakhir dilihat. Frekuensi dilihat dan frekuensi
        turut serta adalah penghitung sejak awal waktu hingga waktu laporan dibuat.
        Maksimum data satu bulan akan diambil. Secara default, ini akan memberi
        data sejak awal minggu sebelumnya.
  this_report_shows_all_the_courses_for_a_given_term_3cdc11e5: "Laporan ini menampilkan semua kursus untuk durasi akademis yang diberikan. File csv yang dihasilkan hanya akan memiliki satu baris per kursus dan akan menampilkan id kursus, id sis kursus, nama singkat kursus, nama kursus, id akun, id sis akun, nama akun, penyimpanan yang digunakan dalam MB, dan jumlah semua file dalam MB. Penyimpanan yang digunakan mencerminkan semua file yang dibandingkan dengan kuota kursus. Jumlah semua file dalam kursus adalah jumlah semua file yang ada dalam kursus, apa pun dampaknya terhadap kuota kursus."
  this_report_shows_grading_period_grades_and_overal_a86346a: "Laporan ini menunjukkan nilai periode penilaian (dan nilai kursus secara keseluruhan) untuk setiap siswa yang terdaftar dalam jangka waktu tertentu. File csv yang dihasilkan akan memiliki satu baris per pendaftaran."
