  when_enabled_for_a_child_account_of_a_non_centrall_8b126bc0: |-
      Saat diaktifkan untuk akun anak dari konsorsium yang dikelola tidak terpusat,
      kondisi dan token kunci pengembang dari konsorsium induk tidak akan
      diwariskan ke sub-akun dari konsorsium anak. Saat dinonaktifkan, perilaku
      (tidak konsisten) warisan diikuti. Tanda ini hanya berlaku untuk akun
      _child_ konsorsium. Tanda ini tidak mempengaruhi konsorsium yang dikelola secara terpusat
      dalam cara apa pun.
  when_enabled_for_an_account_sends_data_for_all_lti_77568a4f: |-
      Ketika diaktifkan untuk suatu akun, mengirim data dari semua peluncuran LTO ke PandataEvents sistem
      untuk kueri dan visualisasi. Membutuhkan Peluncuran LTI Log (Admin Situs) juga akan diaktifkan.
  when_enabled_for_the_parent_account_of_a_non_centr_4d7adbaa: |-
      Saat diaktifkan untuk akun induk dari konsorsium yang dikelola tidak secara terpusat,
      mematikan/menghidupkan kunci pengembang di induk tidak akan mempengaruhi pemasangan
      alat dari akun anak. Saat dinonaktifkan, menghidupkan/mematikan
      kunci pengembang yang diwarisi dari Admin Situs pada akun induk dari
      konsorsium yang dikelola secara tidak terpusat akan mempengaruhi alat (hapus/pulihkan) pada akun
      anak (perilaku warisan). Tanda ini hanya berlaku untuk akun _parent_
       konsorsium. Tanda ini tidak mempengaruhi konsorsium yang dikelola secara terpusat dalam cara apa pun.
  when_enabled_lti_1_1_speedgrader_launches_will_set_47dcded1: |-
      Ketika diaktifkan, peluncuran LTI 1.1 SpeedGrader akan menetapkan resource_link_id dan
      resource_link_title ke pengidentifikasi transparansi tugas dan judul
      tugas. Dengan tanda fitur mati, pada peluncuran SpeedGrader, resource_link_id
      dan resource_link_title mengacu kepada alat (bukan tugas) untuk
      alat LTI 1.1 non-Kuis Baru.
  when_enabled_lti_1_3_launches_that_would_be_associ_bfec33fb: |-
